INSERT INTO `anime` (`id`, `title`, `synopsis`, `episodes`, `airingDate`, `status`, `genres`, `studio`, `poster`, `type`) VALUES
(1, 'Suzume no Tojimari', 'On her way to school one day, Suzume Iwato stumbles upon Souta Munakata, a young man searching for abandoned areas. The high school girl directs Souta to a nearby ruin, but out of pure curiosity, she herself decides to head to the same destination.  Once there, Suzume discovers an isolated door with a dreamlike universe lying beyond it—a place that she can see and feel, but not enter. A strange stone rests on the ground nearby, but it turns into a cat-like creature and scurries away when Suzume lifts it. Suddenly afraid, she heads back toward her school, not realizing that her act of leaving the door open will have consequences.  With the \"keystone\" released, the evil within the other universe can now freely escape and wreak havoc throughout Japan. Intending to correct her dangerous mistake, Suzume joins Souta—whose true goal is to prevent evil from festering—in finding and locking all open doors before the country is destroyed.  [Written by MAL Rewrite]', 1, '2024-01-01', 'Finished', 'Adventure, Fantasy', 'CoMix Wave Films', , 'Movie');
