(2, 'Oniichan wa Oshimai!', 'Self-professed \"home security guard\" Mahiro Oyama has not left his home in years, secluding himself in his room playing erotic visual novels. This depraved lifestyle causes his prodigious sister, Mihari, to worry about his well-being. In hopes of solving this problem, she devises a plan to rehabilitate him back to normalcy.  The first part of Mihari\'s plan is to concoct a medicine that changes her brother\'s biological constitution into a bona fide female, much to Mahiro\'s vehement dismay. Stuck in this predicament, Mahiro has no choice but to live out his life as a cute girl until the effect wears off—if it ever does.  [Written by MAL Rewrite]', 12, '2024-01-01', 'Finished', 'Comedy', 'Studio Bind', , 'Series');
INSERT INTO `anime` (`id`, `title`, `synopsis`, `episodes`, `airingDate`, `status`, `genres`, `studio`, `poster`, `type`) VALUES
(5, 'Shuumatsu Nani Shitemasu ka? Isogashii desu ka? Sukutte Moratte Ii desu ka?', 'Putting his life on the line, Willem Kmetsch leaves his loved ones behind and sets out to battle a mysterious monster, and even though he is victorious, he is rendered frozen in ice. It is during his icy slumber that terrifying creatures known as \"Beasts\" emerge on the Earth\'s surface and threaten humanity\'s existence. Willem awakens 500 years later, only to find himself the sole survivor of his race as mankind is wiped out.  Together with the other surviving races, Willem takes refuge on the floating islands in the sky, living in fear of the Beasts below. He lives a life of loneliness and only does odd jobs to get by. One day, he is tasked with being a weapon storehouse caretaker. Thinking nothing of it, Willem accepts, but he soon realizes that these weapons are actually a group of young Leprechauns. Though they bear every resemblance to humans, they have no regard for their own lives, identifying themselves as mere weapons of war. Among them is Chtholly Nota Seniorious, who is more than willing to sacrifice herself if it means defeating the Beasts and ensuring peace.  Willem becomes something of a father figure for the young Leprechauns, watching over them fondly and supporting them in any way he can. He, who once fought so bravely on the frontlines, can now only hope that the ones being sent to battle return safely from the monsters that destroyed his kind.  [Written by MAL Rewrite] ', 12, '2017-04-11', 'Finished', 'Drama, Fantasy, Romance, Sci-Fi', 'Satelight, C2C', , 'Series');
INSERT INTO `anime` (`id`, `title`, `synopsis`, `episodes`, `airingDate`, `status`, `genres`, `studio`, `poster`, `type`) VALUES
(6, 'Touhou Niji Sousaku Doujin Anime: Musou Kakyou', 'In the hidden magical land of Gensokyo, shrine maiden Reimu Hakurei constantly makes sure that supernatural incidents involving mythical creatures known as youkai remain as infrequent as possible. As part of her shrine\'s traditions, she hosts an annual summer banquet that invites a variety of guests, ranging from humans to even the strongest of youkai.\n\nOn the morning of the banquet, however, the shrine\'s donation box suddenly goes missing. Furthermore, there appears to be no trace of any theft whatsoever. As Reimu, her friend Marisa Kirisame, and news reporter Aya Shameimaru investigate the situation, they realize that others also have missing possessions. With each step closer to piecing the puzzle together, the group soon understands that this phenomenon is more than just simple thievery—an incident on par with Remilia Scarlet\'s mist or Yuyuko Saigyouji\'s youkai cherry blossom.\n\n[Written by MAL Rewrite]', 0, '2008-12-29', 'Airing', 'Fantasy', 'Unknown', , 'Movie');

